import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import ShoppingCartOutlinedIcon from '@material-ui/icons/ShoppingCartOutlined';
import WorkOutlineIcon from '@material-ui/icons/WorkOutline';
import PersonOutlineOutlinedIcon from '@material-ui/icons/PersonOutlineOutlined';







const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor:'#C4D2DF',
    flexGrow: 1,
  },
  title: {
    flexGrow: 1,
  },
  btn:{
      float:'right',
  }
}));

export default function Header() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" style={{ background: '#24B8B4' }}>
        <Toolbar>
          <Typography>
              <Button>Post Project</Button>
          </Typography>
          <Typography>
              <Button>Contest</Button>
          </Typography>
          <Typography>
              <ShoppingCartOutlinedIcon />
              <Button>Buy Services</Button>
          </Typography>
          <Typography>
              <WorkOutlineIcon />
              <Button>Find Jobs</Button>
          </Typography>
          <Typography>
              <PersonOutlineOutlinedIcon />
              <Button>Find Freelancers</Button>
          </Typography>
          <Typography className={classes.btn}>
          <Button color="inherit">Login</Button>
          <Button color="inherit">Signup</Button>
          </Typography>         
        </Toolbar>
      </AppBar>

          <Toolbar style={{backgroundColor:'white'}}>
              <Typography>
                  <Button>
                    OverView
                  </Button>
              </Typography>
              <Typography>
                  <Button>
                      PortFolio
                  </Button>
              </Typography>
              <Typography>
                  <Button>
                      Services
                  </Button>
              </Typography>
              <Typography>
                  <Button>
                      Project History
                  </Button>
              </Typography>
              <Typography>
                  <Button>
                      Endorsements
                  </Button>
              </Typography>
          </Toolbar>
    </div>
  );
}
